import { h } from "@stencil/core";
import GitHubCalendar from "github-calendar";
export class GithubAlikeCalendar {
    componentDidLoad() {
        // Thanks for @IonicaBizau for Github Calender lib
        GitHubCalendar(this.el.shadowRoot.getElementById("calendar"), "imhta", { responsive: this.responsive });
    }
    render() {
        return (h("div", { class: "calendar", id: "calendar" },
            h("p", null, "loading github data...")));
    }
    static get is() { return "github-alike-calendar"; }
    static get encapsulation() { return "shadow"; }
    static get originalStyleUrls() { return {
        "$": ["github-alike-calendar.css"]
    }; }
    static get styleUrls() { return {
        "$": ["github-alike-calendar.css"]
    }; }
    static get properties() { return {
        "username": {
            "type": "string",
            "mutable": false,
            "complexType": {
                "original": "string",
                "resolved": "string",
                "references": {}
            },
            "required": false,
            "optional": false,
            "docs": {
                "tags": [],
                "text": ""
            },
            "attribute": "username",
            "reflect": false
        },
        "responsive": {
            "type": "boolean",
            "mutable": false,
            "complexType": {
                "original": "boolean",
                "resolved": "boolean",
                "references": {}
            },
            "required": false,
            "optional": false,
            "docs": {
                "tags": [],
                "text": ""
            },
            "attribute": "responsive",
            "reflect": false
        }
    }; }
    static get elementRef() { return "el"; }
}
